function hasClass(e,s){return new RegExp(" "+s+" ").test(" "+e.className+" ")}function toggleClass(e,s){var a=" "+e.className.replace(/[\t\r\n]/g," ")+" ";if(hasClass(e,s)){for(;a.indexOf(" "+s+" ")>=0;)a=a.replace(" "+s+" "," ");e.className=a.replace(/^\s+|\s+$/g,"")}else e.className+=" "+s}function select(e){var s=document.querySelectorAll(e);return s.length>1?s:s.item(0)}
